Rayveness, Faye Reagan, Tanya Tate, Georgia Jones, Ariella Ferrera, Shyla Jennings, Shay Fox, Tabby


Shyla wants desperately to be part of the cool crowd but the leg braces she wears makes it hard for her to fit in. One afternoon she is subjected to the cruel machinations of Faye and Georgia who forcibly bind and undress her before they are interrupted by Faye's horrified mother.
In the ensuing aftermath, parents and therapists attempt to counsel the young girls in order to help them better understand their behavior and lesbian tendencies. The older, more experienced women instruct the girls how to properly explore and satisfy their curiousities. Were the girls acting out or did they really know what they were doing?
